import React from "react";
import Navbar from "./navmenu/Navbar";
import Contact from "./Contact";
import { Typography, Box } from "@material-ui/core";
import { useTheme } from "@material-ui/core/styles";
import { makeStyles } from "@material-ui/core/styles";
import animalImg from "../img/animal.jpg";

const useStyles = makeStyles((theme) => ({}));

const Blogs = () => {
  const classes = useStyles();
  const theme = useTheme();
  return (
    <>
      <Navbar />
      <Box>
        <section id="bloglist" class="middle container">
          <h1>these are my blogs</h1>
          <h2 class="thinsubtitle">let's see how this goes</h2>

          <div class="bloglisting">
            <div class="blogimg">
              <img src={animalImg} />
            </div>
            <div class="blogcontent">
              <h3>
                <a href="blogEntry1.html">"animal"</a>
              </h3>
              <p>i found this animal when googling "animals"</p>
            </div>
          </div>

          <div class="bloglisting">
            <div class="blogimg">
              <img src="../img/angrycat.jpg" />
            </div>
            <div class="blogcontent">
              <h3>
                <a href="blogEntry2.html">fan of cats</a>
              </h3>
              <p>i'm a fan of cats</p>
            </div>
          </div>
        </section>
      </Box>
      <Contact />
    </>
  );
};

export default Blogs;
